import React from 'react'
import styles from "./ballred.module.css"

const Ballred = (props) => {
  const { number, color } = props
  return (
    <div className={styles.ballred} style={{ width: number, height: number, backgroundColor: color }}>
    </div>
  )
}

export default Ballred
